function mostrarModal(i) {
    const produc = productos[i];

    // Obtener referencias a los elementos del modal
    const modal = document.getElementById("myModal");
    const modalContent = document.getElementById("modalContent");

    // Rellenar los campos del modal con la información del producto
    let fila = "";

    fila += '<p class="producto">PRODUCTO</p>';
    fila += '<img class="imagenmodel" src="' + produc.imagenURL + '" alt="Imagen del producto"><br>';
    fila += '<p class="palabra" >Id</p>'+'<input id="idproduc" class="inputproduc" type="text" value="' + produc.id + '"><br>';
    fila += '<p>Marca</p>'+'<input class="inputproduc" id="marcaproduc" type="text" value="' + produc.marca + '"><br>';
    fila += '<p>Nombre</p>'+'<input class="inputproduc" id="nombreproduc" type="text" value="' + produc.nombre + '"><br>';
    fila += '<p>Precio</p>'+'<input class="inputproduc "id="precioproduc" type="text" value="' + produc.precio + '"><br>';
    fila += '<p>Categoria</p>'+'<input class="inputproduc" id="categoriaproduc" type="text" value="' + produc.categoria + '"><br>';
    fila += '<p>Peso</p>'+'<input class="inputproduc" id="pesoproduc" type="text" value="' + produc.peso + '"><br>';
    fila += '<p>Descripcion</p>'+'<input class="inputproduc" id="descripcionproduc" type="text" value="' + produc.descripcion + '"><br>';
    fila += '<p>Stock</p>'+'<input class="inputproduc" id="stockproduc" type="text" value="' + produc.stock + '"><br>';
    fila += '<p>Descuento</p>'+'<input class="inputproduc" id="descuentoproduc" type="text" value="' + produc.descuento + '"><br><br>';
    //fila += '<input id="precioproduc" type="text" value="' + produc.precio + '"</input><br><br>';
    fila += '<button class="botonmodel" onclick="actualizarProducto(' + i + ')" >Actualizar Producto</button>';
    fila += '<button class="botonmodel" onclick="cerrarModal()" >Atras</button>';
    
    modalContent.innerHTML += fila;
    

    // Mostrar el modal
    modal.style.display = "block";
}

